var title_f8_17_8470="Cervical spine unilateral facet dislocation";
var content_f8_17_8470=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RADIOL%2F83645&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RADIOL%2F83645&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 480px\">",
"   <div class=\"ttl\">",
"    Cervical spine unilateral facet dislocation with bow tie sign",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 460px; height: 595px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The plain x-ray of the cervical spine in the lateral projection reveals unilateral malalignment of the facets of C3 (red arrows) compared with subjacent column which are widely separated resulting in the bow tie appearance of the posterior elements as they line up (D, red overlay). Associated mild subluxation is present. The yellow arrows show normal alignment of the facet joints of C4, C5, and C6. These findings are reminiscent of a unilateral facet dislocation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
