var title_f8_17_8475="Temperature tissue denaturation";
var content_f8_17_8475=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F69047&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F69047&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Temperature and tissue denaturation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Up to 40&ordm;C",
"       </td>",
"       <td>",
"        No significant cell damage.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Above 40&ordm;C",
"       </td>",
"       <td>",
"        Reversible cell damage, depending on the duration of exposure.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Above 49&ordm;C",
"       </td>",
"       <td>",
"        Irreversible cell damage.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Above 70&ordm;C",
"       </td>",
"       <td>",
"        Coagulation. Collagen is converted to glucose.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Above 100&ordm;C",
"       </td>",
"       <td>",
"        Phase transition from liquid to vapor of the intra- and",
"extra-cellular water. The tissue rapidly dries out. Glucose has an",
"adhesive effect after dehydration.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Above 200&ordm;C",
"       </td>",
"       <td>",
"        Carbonization.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
