var title_f8_17_8476="Promotion of psychosocial skills";
var content_f8_17_8476=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F54909&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F54909&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Suggestions for enhancing a child's psychosocial skills before kindergarten entry",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Parents can promote psychosocial skill development in their children by:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Modeling and encouraging the use of descriptive words to express feelings, rather than physical reactions. Label both positive and negative emotions.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Practicing taking turns whenever possible (eg, in turning pages of a book being read to them, in describing what was seen or what activities were experienced on a family outing, when choosing games to play, etc).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Talking to the child about social interactions witnessed in public or on television, noting what behaviors led to problems, what behaviors were helpful, how a situation might have ended differently if one behavior had been changed.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Practicing listening and following simple directions (eg, \"put the ball behind the chair then take the book to the table, then sit down on the rug\"). Start with a single direction, then two-step directions, then three-step directions, etc., as the child demonstrates mastery.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Reinforcing the child for sharing belongings with other individuals, taking turns, etc.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Practicing sitting and working quietly at a table for a few moments, and gradually increasing the amount of time spent.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Parents can increase their child's exposure to peers and help them to make lasting friendships by:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Joining non-competitive extracurricular activities such as scouting groups (Girl Scouts, Boy Scouts, Indian Princesses, Indian Guides) or activities/sports offered through local organizations, such as the YMCA or museums.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Inviting friends or neighborhood children to go on family outings to the park, movies, shopping, out to eat, etc.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Inviting playmates over to the house on evenings and weekends where parents can monitor and model appropriate social skills and problem solving and to intervene if problems arise.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted in part from recommendations compiled by staff members of the Learning Support Center, Texas Children's Hospital.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
