" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Acromioclavicular injury Type II",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 361px; height: 390px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Type II AC injuries represent a complete tear of the AC ligaments and partial&nbsp;injury of the CC ligaments. In this radiograph of a type II injury, note the subtle difference in AC joint position and slight increase in CC distance. The patient was nontender over the right CC ligaments.",
"    <div class=\"footnotes\">",
